import { Component, OnInit } from '@angular/core';
import { JhiLanguageService } from 'ng-jhipster';
import { Message } from 'primeng/components/common/api';
import { CountryService } from './service/country.service';
import Country from './service/country';

@Component({
    selector: 'jhi-orderlist',
    templateUrl: './orderlistdemo.component.html',
    styles: []
})
export class OrderlistDemoComponent implements OnInit {
    msgs: Message[] = [];
    activeIndex = 0;

    countries: Country[];

    constructor(private countryService: CountryService) {}

    ngOnInit() {
        this.countryService.getCountries().subscribe((countries: any) => {
            this.countries = countries.data;
        });
    }

    onReorder(event: any) {
        this.msgs = [];
        this.msgs.push({ severity: 'info', summary: 'onReorder Event', detail: event.items });
    }

    onChangeStep(label: string) {
        this.msgs.length = 0;
        this.msgs.push({ severity: 'info', summary: label });
    }
}
